import { motion } from 'framer-motion/dist/framer-motion';
import { Hero, Story, Roadmap, Team, Contact } from "../components/home";


const contaierVariants = {
  hidden: {
    opacity:0
  },
  visible: {
    opacity:1,
    transition: { delay: 0.2, duration: 0.5 }
  }

}


function Home() {

return (
<>
  <motion.div
  variants={contaierVariants}

  >

      <Hero />
      <Story />
      <Roadmap />
      <Team />
      <Contact />

  </motion.div>

</>
);

}

export default Home;
